import "../../css/Shared/suggestionBox.css";
import {useState, useEffect} from 'react';
import SuggestedFriendObj from "./SuggestedFriendObj";
import SuggestedLeagueObj from "./SuggestedLeagueObj";
import RecentMedalObj from "./RecentMedalObj";

const SuggestionBox= (props) => {

    let [informationType] = useState(props.children.type);
    let [informationMap, setInformationMap] = useState();

    useEffect(
        () => {
          if (informationType === "friend") {

          } else if(informationType === "league"){

          } else if (informationType === "medal"){

          }
        },[informationType]
      );

    return (
        <div id = "SuggestionBox">
            {
                (informationType === "friend") ?
                <div>
                    <p className = "SuggestionBoxTitle">Suggested Friends</p>
                    <div>
                        {informationMap.map((info) => {return (<SuggestedFriendObj>{{"info":info}}</SuggestedFriendObj>);})}
                    </div>
                </div>
                :
                <></>
            }
            {
                (informationType === "league") ?
                <div>
                    <p className = "SuggestionBoxTitle">Suggested Leagues</p>
                    <div>
                        {informationMap.map((info) => {return (<SuggestedLeagueObj>{{"info":info}}</SuggestedLeagueObj>);})}
                    </div>
                </div>
                :
                <></>
            }
            {
                (informationType === "medal") ?
                <div>
                    <p className = "SuggestionBoxTitle">Recent Medals</p>
                    <div>
                        {informationMap.map((info) => {return (<RecentMedalObj>{{"info":info}}</RecentMedalObj>);})}
                    </div>
                </div>
                :
                <></>
            }

        </div>
    );
}


export default SuggestionBox;
